export const ServicesData={
    '011':{
        name:'accountancy',
        price:400,
    },
    '012':{
        name:'accounting',
        price:850,
    },
    '013':{
        name:'tax counseling',
        price:650,
    },
}

export const getData = (code) => ServicesData[code];
export const getAllServices = () => ServicesData;
export const codes = Object.keys(ServicesData);
